import { Outlet } from "react-router-dom";
import MainNavigation from "../components/MainNavigation";

/*************  ✨ Codeium Command ⭐  *************/
/**
 * The root layout component which renders the main navigation and a main element
 * for the outlet (the page content).
 *
 * @returns {React.ReactElement} The root layout component.
 */
/******  1b87692d-242a-468a-bf06-c9f380c82bce  *******/
function RootLayout() {
  return (
    <>
      <MainNavigation />
      <main>
        <Outlet />
      </main>
    </>
  );
}

export default RootLayout;
